message: "<a href=https://medspravki.shop/sanepidokrugenie.html>Справки об эпидокружении (эпидблагополучии)</a> \r\n \r\nСправку формы 235/у можно получить в частной клинике. Там можно за определенную плату посетить врача, который и выпишет направление для сдачи анализов. Услуги частной клиники обойдутся дороже, чем купить анализ крови и мочи - содержание гормонов и медиаторов у нас. \r\n \r\nПеречень анализов для справки 057/у-04, купить справку без прохождения врачей, справки от невропатолога детям и взрослым, сертификат формы 156/у-93 https://medspravki.shop/contacts.html  покупка медицинского заключения от невропатолога, сдача анализа мочи по Нечипоренко, Медосмотр без справок из ПНД и НД"
